import React from 'react'
import Cookies from 'js-cookie'
import { Link } from 'react-router-dom'


const ProfilButton = () => {

  const id = Cookies.get('id')

  if(id){
    return  <li><Link to="/register">Register</Link></li>
  }else {
  return <div></div>
}
}


export default ProfilButton
